ica.declaracion.descripcion2=Si Usted es obligado a estar inscrito en la Cámara de comercio de Bogotá y encuentra inconsistencias en la información, diríjase a ese organismo para el respectivo ajuste. De lo contrario deberá corregir las posibles inconsistencias a través del módulo RIT de esta Oficina Virtual.
ica.declaracion.descripcion3=Antes iniciar el diligenciamiento de la liquidación, recuerda que debes tener actualizado: Número de establecimientos y Actividades económicas.
ica.declaracion.descripcion4=Para generar declaraciones de otras vigencias ingrese por “Declaraciones” en la parte superior de la pantalla.
